import React from 'react';

const ContactPage = () => {
  return (
    <div className="bg-gray-800 text-white min-h-screen">
      {/* Header Section */}
      <header className="text-center p-10">
        <h1 className="text-4xl font-bold">Contact Us</h1>
        <p className="mt-4 text-xl">Have any questions? Reach out to us!</p>
      </header>

      {/* Contact Form Section */}
      <section className="py-10">
        <form className="w-full max-w-lg mx-auto">
          <label className="block mb-4">Your Name:</label>
          <input className="w-full px-4 py-2 mb-4 bg-gray-700" type="text" />

          <label className="block mb-4">Your Email:</label>
          <input className="w-full px-4 py-2 mb-4 bg-gray-700" type="email" />

          <label className="block mb-4">Message:</label>
          <textarea className="w-full px-4 py-2 mb-4 bg-gray-700" rows="4"></textarea>

          <button className="w-full bg-yellow-500 py-2 rounded-full">Send Message</button>
        </form>
      </section>
    </div>
  );
};

export default ContactPage;
